insert  into `krasnoyarsk_violation_copy`(`ProjectId`,`ProjectCode`,`ProjectUptime`,`ProjectVersion`,`RegionNum`,`MergedTypeId`,`Description`,`Place`,`ComplaintStatus`,`UIKNum`,`TIKNum`,`Media`,`Obsrole`,`Impact`,`Obstime`,`Loadtime`,`Recchanel`,`Hqcomment`,`Obsid`,`Obstrusted`,`PoliceReaction`,`Rectified`,`Rectime`) values ('violation_23857','AG','2012-06-10 16:18:34',1,24,0,'7-30 Не допускают наблюдателя на участок под предлогом отсутствия направления (у наблюдателя есть заявление)','','n',227,33,'a:0:{}','0',0,'2012-06-10 16:18:34','2012-06-10 16:18:34',0,'','',0,0,0,NULL),('violation_23858','AG','2012-06-10 16:18:34',1,24,0,'В документе о назначении члена УИК с правом совещательного голоса требуют поменять заголовок на “направление”.','','n',318,35,'a:0:{}','0',0,'2012-06-10 16:18:34','2012-06-10 16:18:34',0,'','',0,0,0,NULL),('violation_23862','AG','2012-06-10 16:18:34',1,24,0,'На всех участках Кировского района находятся люди в статусе “наблюдателей от ассоциации юристов”. Председатели ТИК  и УИК сообщают, что пускать их – личное распоряжение председателя ГИК.','','n',0,0,'a:0:{}','0',0,'2012-06-10 16:18:34','2012-06-10 16:18:34',0,'','',0,0,0,NULL),('violation_23863','AG','2012-06-10 16:18:34',1,24,0,'Стационарная урна находится не в помещении для голосования; щель не заклеена (нет ленты для заклейки). Увеличенная форма протокола там же.','','n',497,38,'a:0:{}','0',0,'2012-06-10 16:18:34','2012-06-10 16:18:34',0,'','',0,0,0,NULL),('violation_23864','AG','2012-06-10 16:18:34',1,24,0,'На участке 2 наблюдателя от кандидата Коропачинского, ведут себя недружелюбно.','','n',373,36,'a:0:{}','0',0,'2012-06-10 16:18:34','2012-06-10 16:18:34',0,'','',0,0,0,NULL),('violation_23865','AG','2012-06-10 16:18:34',1,24,0,'Не сброшюрованы и книги избирателей, скреплены просто на скоросшиватель.','','n',404,37,'a:0:{}','0',0,'2012-06-10 16:18:34','2012-06-10 16:18:34',0,'','',0,0,0,NULL),('violation_23866','AG','2012-06-10 16:18:34',1,24,0,'Члены избирательной комиссии пользовались карандашами для внесения информации в собственные журналы для записи.','','n',2314,37,'a:0:{}','0',0,'2012-06-10 16:18:34','2012-06-10 16:18:34',0,'','',0,0,0,NULL),('violation_23867','AG','2012-06-10 16:18:34',1,24,0,'Избиратель сообщает, что на каждых выборах в списке избирателей обнаруживает посторонних людей, вписанных по адресу его квартиры.','','n',280,34,'a:0:{}','0',0,'2012-06-10 16:18:34','2012-06-10 16:18:34',0,'','',0,0,0,NULL),('violation_23868','AG','2012-06-10 16:19:09',1,24,0,'На участок приходят люди без прописки в городе, получают бюллетени.','','n',205,33,'a:0:{}','0',0,'2012-06-10 16:19:09','2012-06-10 16:19:09',0,'','',0,0,0,NULL),('violation_23869','AG','2012-06-10 16:19:09',1,24,0,'Удаление ПСГ с участка за видеосъемку и за жалобу касательно неработающего КОИБа.','','n',327,35,'a:0:{}','0',0,'2012-06-10 16:19:09','2012-06-10 16:19:09',0,'','',0,0,0,NULL),('violation_23870','AG','2012-06-10 16:19:09',1,24,0,'Не подписаны книги избирателей и не поставлены печати комиссии. Подозрение на подвоз избирателей.','','n',179,32,'a:0:{}','0',0,'2012-06-10 16:19:09','2012-06-10 16:19:09',0,'','',0,0,0,NULL),('violation_23871','AG','2012-06-10 16:19:09',1,24,0,'Агитационный баннер Акбулатова расположен непосредственно у ИУ.','','n',357,36,'a:0:{}','0',0,'2012-06-10 16:19:09','2012-06-10 16:19:09',0,'','',0,0,0,NULL),('violation_23872','AG','2012-06-10 16:19:09',1,24,0,'На участке находятся социальные и медработники, которые ненавязчиво рекомендуют голосовать за кандидата Акбулатова, вступая в душеспасительные беседы со старушками на тему ЖКХ и нехватки корвалола.','','n',371,36,'a:0:{}','0',0,'2012-06-10 16:19:09','2012-06-10 16:19:09',0,'','',0,0,0,NULL),('violation_23873','AG','2012-06-10 16:19:09',1,24,0,'Не работает камера, направленная на КОИБ.','','n',253,34,'a:0:{}','0',0,'2012-06-10 16:19:09','2012-06-10 16:19:09',0,'','',0,0,0,NULL),('violation_23874','AG','2012-06-10 16:19:09',1,24,0,'Не работает камера, направленная на КОИБ.','','n',254,34,'a:0:{}','0',0,'2012-06-10 16:19:09','2012-06-10 16:19:09',0,'','',0,0,0,NULL),('violation_23875','AG','2012-06-10 16:19:09',1,24,0,'Не работают камеры на участке.','','n',255,34,'a:0:{}','0',0,'2012-06-10 16:19:09','2012-06-10 16:19:09',0,'','',0,0,0,NULL),('violation_23877','AG','2012-06-10 16:19:09',1,24,0,'Не опечатаны переносные урны для голосования, в помещении для голосоания находятся соц. и медработники, проводят измерение давления, общаются с избирателями.','','n',385,36,'a:0:{}','0',0,'2012-06-10 16:19:09','2012-06-10 16:19:09',0,'','',0,0,0,NULL),('violation_23878','AG','2012-06-10 16:19:09',1,24,0,'Комиссия установила урны на месте столов и наоборот, комиссия не попадает в поле зрения камер.','','n',375,36,'a:0:{}','0',0,'2012-06-10 16:19:09','2012-06-10 16:19:09',0,'','',0,0,0,NULL),('violation_23879','AG','2012-06-10 16:19:09',1,24,0,'Не опечатаны выносные урны. Вернувшиеся с голосования члены ИК опечатали урну на улице с имеющимися в ней бюллетенями. Наблюдатели из мобильной группы написали заявлений по факту нарушения закона. Урна признана недействительной целиком.','','n',389,36,'a:0:{}','0',0,'2012-06-10 16:19:09','2012-06-10 16:19:09',0,'','',0,0,0,NULL),('violation_23880','AG','2012-06-10 16:19:09',1,24,0,'На выездном голосовании в списки для надомного голосования после 14 часов вносили еще избирателей. Наблюдатели планируют аннулировать все бюллетени из переносных ящиков.','','n',266,34,'a:0:{}','0',0,'2012-06-10 16:19:09','2012-06-10 16:19:09',0,'','',0,0,0,NULL),('violation_23881','AG','2012-06-10 16:19:09',1,24,0,'На участке ограничивают право СМИ на видеосъемку, повесили табличку “снимать нельзя”.','','n',327,35,'a:0:{}','0',0,'2012-06-10 16:19:09','2012-06-10 16:19:09',0,'','',0,0,0,NULL),('violation_23882','AG','2012-06-10 16:19:09',1,24,0,'Нарушено Постановление ЦИК РФ № № 82/635-6 “О Порядке видеонаблюдения” – веб-камера №1 установлена таким образом, что в нее не просматривается полностью места для выдачи бюллетеней и работы си списками избирателей (нарушен п.2.3).','','n',397,37,'a:0:{}','0',0,'2012-06-10 16:19:09','2012-06-10 16:19:09',0,'','',0,0,0,NULL),('violation_23883','AG','2012-06-10 16:19:09',1,24,0,'В 18-30 председатель попросила расписаться за получение итогового протокола и выдала пустые протоколы с предложением заполнить их самим. Рекомендовано этого не делать.','','n',375,36,'a:0:{}','0',0,'2012-06-10 16:19:09','2012-06-10 16:19:09',0,'','',0,0,0,NULL);

